import React from "react";
import Section1 from "./Section1";
import TenthSection from "./TenthSection";
import { Route, Switch } from "react-router-dom";
import TwelveSection from "./TwelveSection";

function Homepage(props) {
  return (
    <div style={{ marginTop: 10 }}>
      <div>
        <div className="h1">
          <Link to="/9th-10th">
            <Typography>9th-10th</Typography>
          </Link>
        </div>
        <div className="h1">
          <Link to="/11th-12th">
            <Typography>11th-12th</Typography>
          </Link>
        </div>
      </div>
      <Section1 />
      <Switch>
        <Route path="/9th-10th">
          <TenthSection />
        </Route>
        <Route path="/11th-12th">
          <TwelveSection />
        </Route>
      </Switch>
    </div>
  );
}

export default Homepage;
